import './style.css';
import { useState } from 'react';
import HomePage from './pages/HomePage';
import { BrowserRouter,Routes,Route } from 'react-router-dom';
// import Layout from './pages/Layout';
// import Login from './pages/Login';
// import AirportAvailability from './pages/AirportAvailability';
import ProjectContext from './pages/ProjectContext';
import AirportResults from './pages/AirportResults';

function App() {
  const [user,setUser]=useState('')
  return (
    <ProjectContext.Provider value={{user, setUser}}>
    <BrowserRouter>
    <Routes>
    <Route path='/' element={<HomePage/>}/>
    <Route index path='home' element={<HomePage/>}/>
    <Route path='results' element={<AirportResults/>}/>
    </Routes>
    </BrowserRouter>
   </ProjectContext.Provider>
    
  );
}

export default App;
